import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import homeLogo from "../../Assets/standingcat.jpeg";
import Particle from "../Particle";
import Home2 from "./Home2";
import Type from "./Type";
import {
  AiFillGithub,
  AiOutlineTwitter,
  AiFillInstagram,
} from "react-icons/ai";


function Home() {
  return (
    <section>
      <Container fluid className="home-section" id="home">
        <Particle />
        <Container className="home-content">
          <Row>
            <Col md={7} className="home-header">
              {/* <h1 style={{ paddingBottom: 15 }} className="heading">
                Hi There!{" "}
                <span className="wave" role="img" aria-labelledby="wave">
                  üëãüèª
                </span>
              </h1> */}

              <h1 className="heading" style ={{ paddingTop: 50 }}>
                Standing Cat
                <strong className="main-name"> *STD*</strong>
              </h1>

              <h1 className="heading-name" style ={{ paddingTop: 50 }}>
                Lmao the cat is standing lmfao look at the cat that's standing it's funny cuz cats can't stand
              </h1>

              {/* <div style={{ padding: 60, textAlign: "left" }}>
                <Type />
              </div> */}
              <li className="social-icons">
              <a
                href="https://twitter.com/Soumyajit4419"
                style={{ color: "white" }}
                target="_blank" 
                rel="noopener noreferrer"
              >
                <AiOutlineTwitter />
              </a>
            </li>
            </Col>

            <Col md={5} style={{ padding: 50, paddingBottom: 20 }}>
              <img
                src={homeLogo}
                alt="home pic"
                className="img-fluid"
                style={{ maxHeight: "450px" }}
              />
            </Col>
          </Row>
        </Container>
      </Container>
      <Home2 />
    </section>
  );
}

export default Home;
